int chek(char ch){
	int num;
	if(islower(ch)){
		num = ch - 97;
	} else if(isupper(ch)){
		num = ch - 65;
	} else if(ch == '\n'){
		num = 27;
	} else if(ch == ' '){
		num = 26;
	}
	return num;
}

